import React, { Component } from "react";
import NewsItem from "./NewsItem";

export default class News extends Component {
  render() {
    return (
      <div className="container my-3">
        <h2>NewsMonkey-Top Headlines</h2>
        <div className="row">
          <div className="col-md-4">
            <NewsItem
              title="My Title"
              description="This is Description"
              imageUrl="https://static.independent.co.uk/2022/05/19/12/TGM-FF-F-001R.jpg?quality=75&width=1200&auto=webp"
            />
          </div>
          <div className="col-md-4">
            <NewsItem
              title="My Title"
              description="This is Description"
              imageUrl="https://media-cldnry.s-nbcnews.com/image/upload/t_nbcnews-fp-1200-630,f_auto,q_auto:best/rockcms/2022-05/220512-jurassic-world-dominion-ew-618p-23437b.jpg"
            />
          </div>
          <div className="col-md-4">
            <NewsItem title="My Title" description="This is Description" />
          </div>
        </div>
      </div>
    );
  }
}
